<script>
import Fluid from '../src/assets/js/index';
import Leaflet from '../src/assets/leaflet/Leaflet.js';
import {Icons} from '../src/assets/leaflet/Leaflet.js';
export default {
  name: 'app',
  data() {
    return {
  }
  },
  methods: {
    start(){
      Fluid.initialize('logoColorSmall')
      this.initMap();
    },
    initMap(){
      const geoLocation = new function() {
        this.latitude = 52.517600;
        this.longitude = 13.458464;
      };
      var Berlin = [geoLocation.latitude, geoLocation.longitude];

// Create the map
      this.map = Leaflet.map('mapContainer').setView(Berlin, 18);

// Set up the OSM layer
      Leaflet.tileLayer(
              'http://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png', {
                maxZoom: 18
              }).addTo(this.map);

// add a marker in the given location
      Leaflet.marker(Berlin, {icon: Icons.greenIcon}).addTo(this.map);
    }
  }
}
</script>

